import React, { useState } from "react";
import UserInput from "./components/UserInput/UserInput";
import UserList from "./components/UserList/UserList";
// import ErrorModal from "./components/ErrorModal/ErrorModal";

function App() {
  const [list, setList] = useState([
    { username: "andrea", age: 13, id: "a1" },
    { username: "darryl", age: 13, id: "a2" },
  ]);

  const addToList = () => {
    setList((prevState) => [
      ...prevState,
      { username: "new user", age: 45, id: Math.random().toString() },
    ]);
    console.log(list);
  };

  return (
    <div>
      <UserInput add={addToList} />
      <UserList items={list} />
      {/* <ErrorModal /> */}
    </div>
  );
}

export default App;
